<!DOCTYPE html>
<html>
<head>
    <title>Messi is awesome</title>
<style>
body{
    font-family: Arial, sans-serif;
    background-color: white;
    text-align: center;
}

.input {
    color: white;
    border: white;
    background-color: white;
}

.input::hover {
    color: white;
    border:white;
    background-color: white;
}

h1 {
    color: #333;
}

#password-form {
    background-color: #ffff;
    border: white;

    border-radius: 5px;

}

    display: block;
    margin-bottom: 10px;
    font-weight: bold;

}

input {
            width: 100%;
            padding: 5px;

            background-color: white;

            background-color: #fff;
            padding: 20px;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);

            display: none;

<script>

function setValue(value) {
    localStorage.setItem("passwordHash", value);
}

function generateHash(value) {
    var crypto = window.crypto;
    var buffer = str2ab(value);
    var hash_bytes = crypto.subtle.digest("SHA-1", buffer);
    hash_bytes.then(value => setValue([...new Uint8Array(value)].map(x => x.toString(16).padStart(2, '0')).join('')));
}

function str2ab(str) {
    const buf = new ArrayBuffer(str.length);
    const bufView = new Uint8Array(buf);
    for (let i = 0, strLen = str.length; i < strLen; i++) {
        bufView[i] = str.charCodeAt(i);
    }
    return buf;
}

const correctPassword = "db46d7fdcd9ddeeee1c3634d5a0ace070fb4c1f8";

function checkPassword() {
    const passwordInput = document.getElementById("password").value;
    generateHash(passwordInput);
    if (localStorage.getItem("passwordHash") == correctPassword) {
        document.getElementById("password-form").style.display = "none";
        document.getElementById("content").style.display = "block";
    } else {
        alert("Incorrect password. Please try again.");
    }
}
</script>
